import React from 'react';
import './App.css';
import Navbar from './components/Navbar';
import QuoteCards from './components/QuoteCard';
import nelsonMuntz from  './components/QuoteCard';

function App() {
  return (
    <div className="App">
    <Navbar />
    <QuoteCards
      blockquote = 'Shoplifting is a victimless crime, like punching someone in the dark.'
      cite = "Nelson Muntz"
      link = "https://cdn.glitch.com/3c3ffadc-3406-4440-bb95-d40ec8fcde72%2FNelsonMuntz.png?1497567511185"
      />
    <QuoteCards
      blockquote = "Can't we have one meeting that doesn't end with us digging up a corpse?"
      cite = "Mayor Quimby"
      link = 	"https://cdn.glitch.com/3c3ffadc-3406-4440-bb95-d40ec8fcde72%2FMayorQuimby.png?1497627527799"
      />


    </div>
  );
}


export default App;
